import React from 'react';
import { Webcam } from 'react-webcam';

const MyWebcam = () => {
  return (
    <div>
      <Webcam audio={true} video={true} height={480} width={640} screenshotFormat="image/jpeg" />
    </div>
  );
};

export default MyWebcam;
